	add("asphyxia", "{\"term\":\"asphyxia\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"from Ancient greek (to 1453) \u0027ἀσφυξία\u0027 (stopping of the pulse) \u0027ἀ-\u0027 (not) + \u0027σφύξις\u0027 (heartbeat) (from σφυγ-, \u0027σφύζω\u0027 (i throb) .\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The loss of consciousness due to the interruption of breathing and consequent anoxia. Asphyxia can be result from choking, drowning, electric shock, injury\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The loss of consciousness due to the body\u0027s inability to deliver oxygen to its tissues, either by the breathing of air lacking oxygen or by the inability of the blood to carry oxygen. Such asphyxia can be result from the inhalation of non-toxic gases which displace oxygen from the inhaled air, by exposure to carbon monoxide from smoke inhalation such that hemoglobin is poisoned, or the development of methemoglobinemia\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A condition in which an extreme decrease in the concentration of oxygen in the body leads to loss of consciousness or death. The term is now obsolete, having been replace in mid-twentieth century by the more specific terms anoxia, hypoxia, hypoxemia and hypercapnia\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1895\u0027\u0027. Robley Dunglison and Richard J. Dunglison, \u0027A Dictionary of Medical Science containing a full explanation of the various subjects and terms of anatomy, physiology, medical chemistry, pharmacy, pharmacology, therapeutics, medicine, hygiene, dietetics, pathology, bacteriology, surgery, ophthalmology, otology, laryngology, dermatology, gynecology, obstetrics, pediatrics, medical jurisprudence, dentistry, etc. 21 edition\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Hypoxaemia [...is] a deficient oxygenation of the blood; asphyxia from defective oxygenation of the blood\", \"priority\":5}]}, \"synonyms\":{}}");

